import React, { Component } from 'react';

import firebase from '../../services/firebase/setup'
import StudentForm from './StudentForm';
import StudentList from './studentList';
import { Link } from 'react-router-dom'
import { AuthContext } from '../../context/auth';




class Crud extends React.Component {



  handleLogout(){
    console.log('anda')
    firebase.auth().signOut()
    .then(result=> console.log('Salio'))
    .catch(error=>console.log(error))
  }

  render() {
    return (
    <div className="Crud">
    <nav class="navbar navbar-ligth bg-primary">


    <ul class="navbar-nav">
      <li class="nav-item active">
      <Link className="text-white" to="/App">Tennis App  </Link>
      </li>
      <li class="nav-item">
      <Link onClick={this.handleLogout} className="text-white"  to="/">{this.context.user && this.context.user.name}</Link>
      </li>
      <li class="nav-item">
      <Link onClick={this.handleLogout} className="text-white mr-sm-2"  to="/">Exit</Link>
      </li>
    </ul>

</nav>
      <div className="navbar navbar-ligth bg-primary">


      </div>
      <div className="container">
         <div className="col-md-6 m-5 ">
             <StudentForm/>


           </div>
           <div id="Students-list" className="col-md-12 mx-auto m-3">
           <StudentList/>
          </div> 

      </div>

    </div>
    );
  }
}

Crud.contextType =AuthContext;

export default Crud;
